column3:
La SPG permette di fare scambi prodigiosi
di Pokémon via Internet con persone di tutto
{pageend:il mondo.}
Quando concludi uno scambio, un Pokémon
apparirà come contrassegno sul tuo
{pageend:mappamondo.}
Aumentando i punti contrassegnati sul
{pageend:mappamondo, potrai ricevere delle ricompense!}
Continua a fare scambi prodigiosi e arricchisci
il tuo mappamondo personale!

Per fare uno scambio prodigioso, seleziona
{pageend:prima di tutto il Pokémon da inviare, tenendo}
però a mente che alcuni Pokémon non possono
{pageend:essere scambiati in questo modo.}
Poi scegli un punto a piacere sul mappamondo,
per esempio un posto in cui verosimilmente
{pageend:potrebbe vivere il Pokémon che hai inviato.}
A scambio concluso, il Pokémon che hai ricevuto
dall’altro giocatore apparirà come contrassegno
{pageend:sul tuo mappamondo.}
A sua volta, il tuo Pokémon apparirà
come contrassegno sul mappamondo
{pageend:dell’altro giocatore.}
Scoprirai che Pokémon hai ricevuto solo
{pageend:a scambio avvenuto.}
Emozionante, vero?

Puoi vedere il tuo mappamondo e i punti
{pageend:contrassegnati facendo scambi prodigiosi.}
In ognuno dei punti contrassegnati puoi
{pageend:registrare un massimo di cinque Pokémon.}
Puoi anche cambiare il Pokémon usato come
{pageend:contrassegno o eliminare i Pokémon registrati.}
Inoltre puoi ruotare il mappamondo, ingrandirlo
o rimpicciolirlo a tuo piacimento.
